        company: 'Rail Continent',
        price: Math.round(selectedTariff?.cost || data.cost || 0),
        days: selectedTariff?.days || data.days || 5,
        details: {
          tariff: selectedTariff?.name || data.tariff_name || '–ê–≤—Ç–æ–º–∞—Ç–∏—á–µ—Å–∫–∏–π',
          weight: totalWeight,
